import React, { useState, useEffect } from "react";
import { BrowserRouter, Route, Routes, Link, Navigate } from "react-router-dom";
import { createContext, useContext } from "react";

const AuthContext = createContext();

function App() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    const storedUsername = localStorage.getItem("username");
    const storedPassword = localStorage.getItem("password");
    if (storedUsername && storedPassword) {
      setIsLoggedIn(true);
    }
  }, []);

  const handleSignIn = (e) => {
    e.preventDefault();
    if (
      username.length === 5 &&
      password.length >= 8 &&
      /[a-zA-Z]/.test(password) &&
      /[!@#$%^&*]/.test(password)
    ) {
      localStorage.setItem("username", username);
      localStorage.setItem("password", password);
      setIsLoggedIn(true);
    } else {
      alert("Invalid username or password");
    }
  };

  const handleSignOut = () => {
    localStorage.removeItem("username");
    localStorage.removeItem("password");
    setIsLoggedIn(false);
  };

  return (
    <AuthContext.Provider value={{ isLoggedIn, handleSignOut }}>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={<SignInForm handleSignIn={handleSignIn} />}
          />
          <Route
            path="/books"
            element={isLoggedIn ? <BookList /> : <Navigate to="/" />}
          />
          <Route
            path="/books/:bookId"
            element={isLoggedIn ? <BookSummary /> : <Navigate to="/" />}
          />
        </Routes>
      </BrowserRouter>
    </AuthContext.Provider>
  );
}

function SignInForm({ handleSignIn }) {
  return (
    <form onSubmit={handleSignIn}>
      <label>Username:</label>
      <input
        type="text"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <br />
      <label>Password:</label>
      <input
        type="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <br />
      <button type="submit">Sign In</button>
    </form>
  );
}

function BookList() {
  const { handleSignOut } = useContext(AuthContext);
  return (
    <div>
      <h1>Book List</h1>
      <ul>
        <li>
          <Link to="/books/1">Book 1</Link>
        </li>
        <li>
          <Link to="/books/2">Book 2</Link>
        </li>
        <li>
          <Link to="/books/3">Book 3</Link>
        </li>
      </ul>
      <button onClick={handleSignOut}>Sign Out</button>
      <Link to="/">Back</Link>
    </div>
  );
}

function BookSummary() {
  const { handleSignOut } = useContext(AuthContext);
  const bookId = window.location.pathname.split("/").pop();
  return (
    <div>
      <h1>Book Summary - {bookId}</h1>
      <p>This is the summary of book {bookId}</p>
      <button onClick={handleSignOut}>Sign Out</button>
      <Link to="/books">Back</Link>
    </div>
  );
}

export default App;
